function toProxy(url) {
  return `${YOUR_WORKER_ENDPOINT}?url=${encodeURIComponent(url)}`;
}

export async function fetchJSON(url, { timeoutMs = 15000 } = {}) {
  const controller = new AbortController();
  const timer = setTimeout(() => controller.abort(), timeoutMs);
  try {
    const res = await fetch(toProxy(url), { signal: controller.signal });
    if (!res.ok) throw new Error(`HTTP ${res.status}`);
    const ct = res.headers.get('content-type') || '';
    if (ct.includes('application/json')) return await res.json();
    return await res.text(); // non-JSON fallback
  } finally {
    clearTimeout(timer);
  }
}

export async function get(nameOrUrl, options) {
  const url = API[nameOrUrl] ?? nameOrUrl;
  return fetchJSON(url, options);
}
